import Expense from './components/Expenses/expenses.js';
import Expenseform from './components/NewExpenses/Expensefrom.js';
import NewExpense from "./components/NewExpenses/newExpense.js";

function App() {
  const expenses = [
    {
      id: "e1",
      title: Expenseform.expenseData.title,
      amount: 94.12,
      date: new Date(2021, 7, 14),
    },
    { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: "e3",
      title: "Car Insurance",
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: "e4",
      title: "New Desk (Wooden)",
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  return (

      <div className="App">
           <div>
      <NewExpense/>
      </div>
        {/* <h1>Welcome to world</h1> */}
        <Expense items={expenses}/>
        {/* <expenseform/> */}
      </div>
  );
}

export default App;
